import React from "react";
import {MdHome, MdVideoLibrary} from 'react-icons/md';
import {BsFillCollectionPlayFill} from 'react-icons/bs';
import { AiOutlinePlusCircle } from "react-icons/ai";

function BottomNav() {
    return (
        <div className="d-flex d-lg-none d-md-none justify-content-between fixed-bottom bg-light">
                <a className="btn btn-default text-center" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem", color:"blue" }}>Home</span></a>
                <a className="btn btn-default text-center" href="/"><MdHome color="grey" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Shorts</span></a>
                <a className="btn btn-default text-center mt-2" href="/"><AiOutlinePlusCircle color="grey" fontSize="2rem" /><br/></a>
                <a className="btn btn-default text-center" href="/"><BsFillCollectionPlayFill color="grey" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Subscriptions</span></a>
                <a className="btn btn-default text-center" href="/"><MdVideoLibrary color="grey" fontSize="1.5rem" /> <br/><span style={{ fontSize:"0.8rem" }}>Library</span></a>
        </div>
    );

}


export default BottomNav;
